import React, { useState, useEffect } from 'react';

function Demo() {
  const [sum, setSum] = useState(null);

  useEffect(() => {
    const importObject = {
      module: {},
      env: {
        memory: new WebAssembly.Memory({ initial: 256 }),
      }
    };

    async function loadWebAssembly() {
      const result = await WebAssembly.instantiateStreaming(fetch('add.wasm'), importObject);
      const Sum = result.instance.exports.Sum;
      setSum(Sum(4, 5));
    }

    loadWebAssembly().catch(console.error);
  }, []);

  return (
    <div>
      <p>First trial of embedding webassembly</p>
      <p>Sum: {sum !== null ? sum : "Loading..."}</p>
    </div>
  );
}

export default Demo;
